import React from 'react';
import { Link } from 'react-router-dom';

const CallToAction = () => {
  return (
    <section className="bg-navy py-16 text-white text-center">
      <div className="container mx-auto px-4">
        <h2 className="text-3xl md:text-4xl font-bold mb-4 text-blue-300">
          Ready to Start Your Journey?
        </h2>
        <p className="text-lg mb-8 max-w-2xl mx-auto">
          Contact us today to learn how we can help you achieve your academic goals.
        </p>
        <Link
          to="/contact"
          className="inline-block px-8 py-3 bg-white text-navy font-semibold rounded-md hover:bg-gray-100 transition-colors duration-300"
        >
          Get in Touch
        </Link>
      </div>
    </section>
  );
};

export default CallToAction;
